import React, { Component } from "react"

class Song extends Component {
    constructor(props) {
        super(props);

    }
    render() { 
        return ( 
            <div>
                <h3>Peep my current favorite song!</h3>
               <iframe src="https://open.spotify.com/embed/track/5M4yti0QxgqJieUYaEXcpw" width="300" height="380" frameborder="0" allowtransparency="true" allow="encrypted-media"></iframe>
            </div>
         );
    }
}

export default Song;
